import {PlusIcon} from "@primer/octicons-react";
import './navbar.css';

function Navbar() {
    return (
        <div className="navbar" id="top_navbar">
            <div id="top_navbar_left">
                <div id={"title_wrapper"}>
                    <h1 id="title">Reminders.py</h1>
                    <p>but it's built in react?</p>
                </div>
            </div>
            <div id={"top_navbar_center"}>
                <div id={"pages"}>
                    <a>Reminders</a>
                    <a>About</a>
                </div>
            </div>
            <div id="top_navbar_right">
                <button className="button important-button"><PlusIcon className={"icon"} fill={"white"} size={24} verticalAlign={"middle"}/> <span class={"important-button-text"}>New Reminder</span></button>
            </div>
        </div>
    );
}

export default Navbar;
